class Solution {

    /**
     * @param String $s1
     * @param String $s2
     * @return Boolean
     */
    function checkStrings($s1, $s2) {
        $n = strlen($s1);
        $count1 = array_fill(0, 26, [0, 0]); // Count for s1: even [0], odd [1]
        $count2 = array_fill(0, 26, [0, 0]); // Count for s2: even [0], odd [1]

        // Count the frequency of each character at even and odd positions
        for ($i = 0; $i < $n; $i++) {
            $index = ord($s1[$i]) - ord('a');
            $count1[$index][$i % 2]++;

            $index = ord($s2[$i]) - ord('a');
            $count2[$index][$i % 2]++;
        }

        // Check if frequencies match for even and odd positions
        for ($i = 0; $i < 26; $i++) {
            if ($count1[$i][0] != $count2[$i][0] || $count1[$i][1] != $count2[$i][1]) {
                return false;
            }
        }

        return true;
    }
}
